import styled from "styled-components";
import { PRIMARY_COLOR, COLOR_WHITE } from "../../styles/color";

export const FlexContainer = styled.div`
  display: flex;
  justify-content: center;
  height: 600px;
  padding-bottom: 120px;
  background-color: ${COLOR_WHITE};
`;
